import React from 'react';
import './.css';

const sportsEvents = [
  { id: 1, image: '/path_to_image_1.png', title: 'Chennai Chess Club - Blitz Event' },
  { id: 2, image: '/path_to_image_2.png', title: 'Chess Club - Connect Online Chess Classes' },
  { id: 3, image: '/path_to_image_3.png', title: 'Rapid Chess Tournament Championship' },
  { id: 4, image: '/path_to_image_4.png', title: 'Chess Championship 2024' },
  { id: 5, image: '/path_to_image_5.png', title: 'Mega Marathon Event 2024' },
  { id: 6, image: '/path_to_image_6.png', title: 'Hercules Virtual Marathon' },
  { id: 7, image: '/path_to_image_7.png', title: 'Mahatma 10K Challenge' },
  { id: 8, image: '/path_to_image_8.png', title: 'Virtual Race Event' },
  { id: 9, image: '/path_to_image_9.png', title: 'ISL 2024-25 Chennaiyin FC vs Goa' },
  { id: 10, image: '/path_to_image_10.png', title: 'Chennaiyin FC vs East Bengal' },
  // Add more events as necessary
];

const SportsEvents = () => {
  return (
    <div className="sports-events-container">
      <h2>Sports Events</h2>
      <div className="grid-container">
        {sportsEvents.map(event => (
          <div key={event.id} className="event-card">
            <img src={event.image} alt={event.title} className="event-image" />
            <h3>{event.title}</h3>
          </div>
        ))}
      </div>
    </div>
  );
};

export default SportsEvents;
